import axios from 'axios';

let name = "banana"

const INGREDIENT_REST_API_URL = `http://localhost:8080/ingredients/steak`;

class IngredientService {

    getIngredient() {
      return axios.get(INGREDIENT_REST_API_URL);  
    }
}

export default new IngredientService()
